import React from 'react'

function ContactUsHeading() {
  return (
    <>
      <div className="bg-gray-100 text-center p-12 pb-20">
        <h1 className="font-parisienne text-h1 font-semibold mb-3">Contact Us</h1>
        <p className="font-rubik md:px-32 text-gray-700">Et harum quidem rerum facilis est et expedita distinctio.
        Nam libero tempore, cum soluta nobis est eligendi optio cumque nihil.</p>
      </div>
      <img src="contact/8.jpg"/>
    </>
  )
}
export { ContactUsHeading }
